import React from "react";
import Skills from "./Skills.json";
import Skill from "./Skill"
const SkillGroupings = props =>{
    const skills = Skills.skills.map((skill,i)=>
        <Skill 
            skillInfo = {skill}
            key={i+"-key"}
        />
    );
    return(
        <div>
            {skills}
        </div>
    );
}
export default SkillGroupings;
